import React, { useState } from "react";
import axios from "axios";

function App() {
  const [place, setPlace] = useState("");
  const [members, setMembers] = useState("");
  const [budget, setBudget] = useState("");
  const [foodPreference, setFoodPreference] = useState("No");
  const [hotels, setHotels] = useState([]);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState("");

  const fetchHotels = async () => {
    setLoading(true);
    setError("");
    setHotels([]);

    try {
      const response = await axios.post("http://localhost:5000/api/travel-guide", {
        place,
        members,
        budget,
        foodIncluded: foodPreference === "Yes", 
      });

      setHotels(response.data.hotels);
    } catch (err) {
      setError("Error fetching data. Try again.");
    }

    setLoading(false);
  };

  return (
    <div className="min-h-screen bg-gradient-to-br from-purple-300 to-blue-300 flex flex-col items-center justify-center p-6">
      <div className="w-full max-w-lg bg-white shadow-2xl rounded-2xl p-8 text-center">
        <h2 className="text-4xl font-extrabold text-indigo-800 mb-6">üåç Travel Guide AI</h2>
        <div className="space-y-4">
          <input
            type="text"
            placeholder="Enter Place"
            className="w-full p-4 border rounded-lg focus:ring-2 focus:ring-indigo-400 shadow-md"
            value={place}
            onChange={(e) => setPlace(e.target.value)}
          />
          <input
            type="number"
            placeholder="Number of Members"
            className="w-full p-4 border rounded-lg focus:ring-2 focus:ring-indigo-400 shadow-md"
            value={members}
            onChange={(e) => setMembers(e.target.value)}
          />
          <input
            type="number"
            placeholder="Budget (‚Çπ)"
            className="w-full p-4 border rounded-lg focus:ring-2 focus:ring-indigo-400 shadow-md"
            value={budget}
            onChange={(e) => setBudget(e.target.value)}
          />
          <select
            className="w-full p-4 border rounded-lg focus:ring-2 focus:ring-indigo-400 shadow-md"
            value={foodPreference}
            onChange={(e) => setFoodPreference(e.target.value)}
          >
            <option value="No">No Food</option>
            <option value="Yes">Food Required</option>
          </select>
          <button
            onClick={fetchHotels}
            className="w-full bg-indigo-500 text-white p-4 rounded-lg hover:bg-indigo-600 transition duration-300"
          >
            {loading ? "Searching..." : "Find Hotels"}
          </button>
        </div>
      </div>

      {error && <p className="text-red-500 text-center mt-4">{error}</p>}

      {hotels.length > 0 && (
        <div className="mt-10 w-full max-w-2xl">
          <h3 className="text-2xl font-semibold mb-4 text-gray-800">üè® Recommended Hotels:</h3>
          <ul className="space-y-6">
            {hotels.map((hotel, index) => (
              <li key={index} className="p-6 border rounded-lg bg-white shadow-lg">
                <h4 className="font-bold text-lg">{hotel.name}</h4>
                <p>üìç {hotel.location}</p>
                <p>üìû Contact: {hotel.phone || "Not available"}</p>
                <p>üí∞ Price: ‚Çπ{hotel.price?.startingFrom || hotel.price || "N/A"}</p>
                <p className="text-sm font-medium">üçΩ Food Included: <span className={hotel.foodIncluded ? "text-green-600" : "text-red-600"}>{hotel.foodIncluded ? "Yes" : "No"}</span></p>
                <a href={hotel.mapLink} target="_blank" rel="noopener noreferrer" className="text-blue-500 underline mt-2 inline-block">üåç View on Google Maps</a>
              </li>
            ))}
          </ul>
        </div>
      )}
    </div>
  );
}

export default App;
